import React, { useEffect, useState } from "react";
import "./View.css";

function View({ content, selectedContent }) {
  const [value, setvalue] = useState("");
  useEffect(() => {
    if (selectedContent) {
      setvalue(selectedContent.title);
    }
  });

  return (
    <div className="View">
      <div className="View__item">
        {
          <li className="View__list" key={content.id}>
            <div className="username">{content.username}</div>
            <div className="title">{content.title}</div>
            <div className="title">{content.content}</div>
            <div className="createAt">{content.createdAt}</div>
          </li>
        }
      </div>
      <div className="View__btns">
        <button className="수정">수정</button>
        <button className="삭제">삭제</button>
      </div>
    </div>
  );
}

export default View;
